                                                            <div class=""card-body"">
                                                                <p");
            WriteLiteral(@" class=""mb-0"">If several languages coalesce, the grammar of the resulting language is more simple and regular than that of the individual languages. The new common language will be more simple and regular than the existing European languages.</p>
